import styled from "styled-components";

const HeaderWrap = styled.div`
    display: flex;
    height: 35px;
    width: 100%;
    background-color: black;
    padding: 10px;
`;

const Logo = styled.img`
    height: 35px;
    margin-top: 3px;
    margin-left: 20px;
`;

const SearchBox = styled.input`
    width: 300px;
    margin-left: 20px;
`;

